set pid_pro =(select Id_Proveedor  from productos where nombre like concat('%',pCodigo,'%')  limit 0,1);
set ppreciodoc =(select preciodocena  from productos where nombre like concat('%',pCodigo,'%')  limit 0,1);
insert into producto (nombre,precio,cantidad,ip_proveedor,preciodocena,estado)values(pnombre,pprecio,pcantidad,pid_pro,ppreciodoc,0);
delete from productos where idproducto = pidproducto;
select pidproducto;
END ;;
