CREATE DEFINER=`root`@`localhost` PROCEDURE `llenar detalle`()
BEGIN
declare contador int;
declare maxid int;
declare pcosto int;
declare producto int;
set contador = 1;
set maxid =(select max(iddetallefactura) from detallesfacturas);
while contador <= maxid do
	if exists (select * from detallesfacturas where iddetallefactura=contador) then
		set producto = (select idproducto from detallesfacturas where iddetallefactura=contador);
		update detallesfacturas set costo = (select costo from productos where idproducto = producto) where iddetallefactura=contador;
	end if;
set contador = contador+1;
end while;

END ;;
