CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_COMPARESALE`(
pFecha date
)
BEGIN
declare pFecha2  date ;
set pFecha2 = DATE_ADD(pfecha ,interval -1 year);
select (SELECT (sum(b.total)) FROM facturas b where b.estado=0 and b.total > 0 and b.fecha=(pFecha2)) as firtsTotal ,
(SELECT pFecha2)  as firtsDate,  
(SELECT sum(b.total) FROM facturas b where b.fecha=pFecha and b.estado=0 and b.total > 0) as secondTotal,
(SELECT pFecha)  as secondDate,
(select (sum(a.total))from facturas a where a.estado =0 and a.Total>0 and month(a.fecha)=month(pFecha2) and year(a.fecha)=(year(pFecha2))) as totalFirtsMonth,
(select (sum(a.total))from facturas a where a.estado =0 and a.Total>0 and month(a.fecha)=month(pFecha) and year(a.fecha)=(year(pFecha)))as totalsecondMonth;
END ;;
