CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_D_DETALLE`(
pId int)
BEGIN
declare ptotal float;
declare totalfactura float;
declare cantidadp int;
declare cantidadproducto int;
declare pidproducto int;

set pidproducto = (select idproducto from detallesfacturas where iddetallefactura=pId);
set cantidadproducto = (select cantidad from productos where idproducto = pidproducto);
update productos set cantidad = cantidadproducto+1 where idproducto = pidproducto;
select pidproducto;
if (select Cantidad from detallesfacturas where iddetallefactura=pId)=1 then
		update detallesfacturas set estado =1 where iddetallefactura =pId;
		set ptotal =  ((select total from detallesfacturas where iddetallefactura =pId)-(select precioventa from detallesfacturas where iddetallefactura =pId));
		set totalfactura = (select total from facturas where idfactura = (select Id_Factura from detallesfacturas where iddetallefactura =pId)) - (select precioventa from detallesfacturas where iddetallefactura =pId); set cantidadp = (select cantidad from detallesfacturas where iddetallefactura =pId)-1;
		update facturas set total = totalfactura where idfactura = (select Id_Factura from detallesfacturas where iddetallefactura =pId) ;
 
   else
		set ptotal =  ((select total from detallesfacturas where iddetallefactura =pId)-(select precioventa from detallesfacturas where iddetallefactura =pId));
		set totalfactura = (select total from facturas where idfactura = (select Id_Factura from detallesfacturas where iddetallefactura =pId)) - (select precioventa from detallesfacturas where iddetallefactura =pId);
		set cantidadp = (select cantidad from detallesfacturas where iddetallefactura =pId)-1;
		update detallesfacturas  set cantidad = cantidadp, total = ptotal where iddetallefactura = pId;
		update facturas set total = totalfactura where idfactura = (select Id_Factura from detallesfacturas where iddetallefactura =pId) ;
  
  end if;
END ;;
DELIMITER ;
