CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_S_DETALLES`(
pFecha date)
BEGIN
select a.iddetallefactura, a.cantidad, c.nombre, ROUND((a.costo * a.cantidad),2) as Costo , a.total, ROUND(( a.total - (a.costo * a.cantidad)),2) As Ganancia from detallesfacturas a
inner join facturas b on b.idfactura=a.Id_Factura
inner join productos c on c.idProducto=a.idProducto
where b.fecha = pFecha and year(b.fecha)=year(pfecha) and b.estado =0 and  a.estado=0 order by a.idDetalleFactura desc  ;
END ;;
DELIMITER ;
