CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_S_TOTAL`(
pFecha date
)
BEGIN
select sum(a.precioventa * a.cantidad) as Venta,ROUND(sum(( a.total - (c.costo * a.cantidad))),2 ) As Ganancia
from detallesfacturas a
inner join facturas b on b.idfactura=a.Id_Factura
inner join productos c on c.idProducto=a.idProducto
where month( b.fecha) = month(pFecha) and year(b.fecha)=year(pfecha) and a.estado=0 and b.estado =0;
