CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_Ticket`(
pId int)
BEGIN
select a.idfactura as Id, d.usuario as Usuario, a.Hora as Hora, a.fecha as Fecha, c.nombre as Cliente,a.total as TotalFactura,a.efectivo as Efectivo,a.Cambio as Cambio, b.cantidad as Cantidad, e.nombre as Producto, b.precioventa as Valor, b.total as Total from facturas a 
inner join detallesfacturas b on a.idfactura = b.Id_Factura 
inner join clientes c on a.Cliente = c.idCliente
inner join administradores d on a.Cajero = d.idAdmin
inner join productos e on b.idProducto = e.idProducto
 where b.Id_factura = pId group by b.idDetalleFactura;

END ;;
