CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_U_PRODUCTOSINVENTARIO`(
pId int,
pCantidad int)
BEGIN
declare cantidadBase int;
set cantidadBase = (Select Cantidad from productos where idproducto = pid);
if cantidadBase <=0 then
update productos set Cantidad=pCantidad  where  idproducto = pid;
else
update productos set Cantidad=pCantidad+cantidadBase  where  idproducto = pid;
end if;
END ;;
