CREATE DEFINER=`root`@`localhost` PROCEDURE `VENTASEMANALPRODUCTOS`(
PFECHA DATE)
BEGIN
select a.idProducto,a.nombre ,sum(d.cantidad) as Venta from detallesfacturas d
inner join facturas c on c.idfactura=id_factura
inner join productos a on a.idProducto=d.idProducto
where week(c.fecha)=week(PFECHA) and d.estado=0 group by a.idProducto order by sum(d.cantidad) desc limit 30;
END ;;
